import React from "react";
import {
  AboutContainer,
  AboutBg,
  AboutContent,
  AboutH1,
  AboutP,
  AboutIconRow,
  AboutIcon,
  AboutFrost,
} from "./AboutElms";
import CSS from "../../images/css.png";
import HTML from "../../images/html-5.png";
import JS from "../../images/js.png";
import PN from "../../images/python.png";
import PS from "../../images/ps.png";
import AI from "../../images/ai.png";
import MV from "../../images/magicavoxel.png";
import BD from "../../images/blender.png";

const About = () => {
  return (
    <AboutContainer id="about">
      <AboutBg>
        <AboutContent>
          <AboutH1>About Me</AboutH1>
          <AboutIconRow>
            <AboutIcon src={CSS} type="image/png" />
            <AboutIcon src={HTML} type="image/png" />
            <AboutIcon src={JS} type="image/png" />
          </AboutIconRow>
          <AboutIconRow>
            <AboutIcon src={PN} type="image/png" />
            <AboutIcon src={PS} type="image/png" />
            <AboutIcon src={AI} type="image/png" />
          </AboutIconRow>
          <AboutIconRow>
            <AboutIcon src={MV} type="image/png" />
          </AboutIconRow>
        </AboutContent>
        <AboutFrost />
      </AboutBg>
    </AboutContainer>
  );
};

export default About;

